package com.debajoy.ds.heap;

import java.util.Arrays;
import java.util.Comparator;
import java.util.HashMap;
import java.util.Map;
import java.util.PriorityQueue;

/**
 * @author Debajoy
 *
 */
public class SortByFreqCharacter {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		System.out.println(frequencySort("tree"));
		System.out.println(frequencySortOptimized(""));
	}
	
    public static String frequencySort(String s) {
        if(s == null){
        	return null;
        }
        StringBuilder sOut = new StringBuilder("");
		PriorityQueue<CharFreq> minHeap = new PriorityQueue<CharFreq>(new Comparator<CharFreq>() {
			@Override
			public int compare(CharFreq o1, CharFreq o2) {
				// TODO Auto-generated method stub
				return Integer.valueOf(o2.i).compareTo(Integer.valueOf(o1.i));
			}
		});
		Map<Character,Integer> mapChar = new HashMap<Character,Integer>();
		for(int i = 0 ;i< s.length(); i++){
			if(mapChar.get(s.charAt(i))== null){
				mapChar.put(s.charAt(i), 1);
			}else{
				mapChar.put(s.charAt(i), mapChar.get(s.charAt(i))+1);
			}
		}
		
		for(Map.Entry<Character,Integer> map : mapChar.entrySet()){
			CharFreq fre = new CharFreq(map.getKey(),map.getValue());
			minHeap.add(fre);
		}
		while(minHeap.size() > 0){
			CharFreq fre = minHeap.poll();
			int k = fre.i;
			while(k > 0){
				sOut.append(String.valueOf(fre.c));
				k--;
			}
		}
		return sOut.toString();
    }
    
    public static String frequencySortOptimized(String s) {
    	 if(s == null){
         	return null;
         }
    	 StringBuilder sOut = new StringBuilder("");
    	 CharFreq[] chararr = new CharFreq[123];
    	 for(int i = 0; i < chararr.length; i++){
    		 chararr[i] = new CharFreq('1', 0);
    	 }
    	 for(int i = 0 ;i< s.length(); i++){
    		 char c = s.charAt(i);
    		 int ascii = c;
    	  	 chararr[ascii].c = c;
        	 chararr[ascii].i += 1; 
    	 }
    	 Arrays.sort(chararr,new Comparator<CharFreq>() {
			@Override
			public int compare(CharFreq o1, CharFreq o2) {
				return Integer.valueOf(o2.i).compareTo(Integer.valueOf(o1.i));
			}
		});
    	 for(int i = 0 ; i < chararr.length; i++){
    		 if(chararr[i] != null && chararr[i].i > 0){
        		 CharFreq fre = chararr[i];
        		 int k = fre.i;
     			while(k > 0){
    				sOut.append(String.valueOf(fre.c));
    				k--;
    			}
    		 }
    	 }       
         return sOut.toString();
    }
}

class CharFreq{
	public CharFreq(char c, int i) {
		super();
		this.c = c;
		this.i = i;
	}
	char c;
	int i;
}